import React, { Component } from "react";
import "./forestanim.css";
import Grass from "./grassbackground.png";

class ForestAnim extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return <div className="grass"></div>;
  }
}

export default ForestAnim;
